import React, { useState } from 'react';
import './createevent.css'; // Your CSS file for CreateEvent component

const CreateEvent = () => {
  const [formData, setFormData] = useState({
    eventType: '',
    eventName: '',
    collegeName: '',
    posterimg: null,
    cashPrize: '',
    description: '',
    website: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleImageChange = (e) => {
    // Handle image upload using multer or other image processing library
    const file = e.target.files[0];
    // Process the file as needed
    console.log('Uploaded image:', file);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
  
    try {
      const formDataToSend = new FormData();
      formDataToSend.append('eventType', formData.eventType);
      formDataToSend.append('eventName', formData.eventName);
      formDataToSend.append('collegeName', formData.collegeName);
      formDataToSend.append('posterImage', formData.posterimg);
      formDataToSend.append('cashPrize', formData.cashPrize);
      formDataToSend.append('description', formData.description);
      formDataToSend.append('website', formData.website);
  
      const response = await fetch('/api3/createevent', {
        method: 'POST',
        body: formDataToSend,
      });
  
      if (response.ok) {
        const data = await response.json();
        console.log('Event created:', data);
        // Optionally, perform additional actions after successful form submission
      } else {
        throw new Error('Failed to create event');
      }
    } catch (error) {
      console.error('Error:', error.message);
      // Handle error state or display an error message to the user
    }
  };
  

  return (
    <div className="create-event-container">
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="eventType">Type of Event:</label>
          <input
            type="text"
            id="eventType"
            name="eventType"
            value={formData.eventType}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="eventType">Event Name:</label>
          <input
            type="text"
            id="eventType"
            name="eventType"
            value={formData.eventType}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="eventType">College Name</label>
          <input
            type="text"
            id="eventType"
            name="eventType"
            value={formData.eventType}
            onChange={handleChange}
            required
          />
        </div>

        {/* ... Other form fields */}
        <div className="form-group">
          <label htmlFor="posterImage">Poster Image</label>
          <input
            type="file"
            id="posterImage"
            name="posterImage"
            onChange={handleImageChange}
            accept="image/*"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="cashPrize">Cash Prize</label>
          <input
            type="text"
            id="cashPrize"
            name="cashPrize"
            value={formData.cashPrize}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="eventType">Description about the event:</label>
          <input
            type="text"
            id="eventType"
            name="eventType"
            value={formData.eventType}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="eventType">Website link</label>
          <input
            type="text"
            id="eventType"
            name="eventType"
            value={formData.eventType}
            onChange={handleChange}
            required
          />
        </div>
        {/* ... Other form fields */}
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default CreateEvent;
